import { Component } from 'react'
import axios from 'axios';
import ResultsDisplay from '../resultsDisplay/ResultsDisplay'
import TextField from 'material-ui/TextField'

class SearchBar extends Component{
    render() {
        console.log(this.state);
        return (
            <div style={{padding: '50px'}}>
                <TextField name="searchText" value={this.state.searchText} onChange={this.onTextChange} floatingLabelText="Search for image" fullWidth={true} />


                <input type="button" onClick="displayImages()"></input>

            </div>
)


}
}

function searchImages () {
    var API_KEY = '32265864-051f1f4a77558a7656ff80c35';
    axios.get(`https://cors-anywhere.herokuapp.com/https://pixabay.com/api/?key=${API_KEY} &q=${this.state.searchText}
                &safesearch=true`).then(response => {
                    this.setState({
                        images: response.data.hits
                    });
                }).catch(err => {
                    console.log(err);
});
}


async function displayImages () {
    var x= await searchImages();
